import React from 'react';
import './index.scss';
import Error from '../error';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from "react-router-dom";


function Page() {
  return (

 <div>
<Switch>
<Route path="/">
    <div> Home1</div>
</Route>
<Route path="/about">
    <div>About1</div>
</Route>
<Route path="/projects">
    <div>Users1</div>
</Route>
<Route path="*">
    <Error/>
</Route>
</Switch>

 </div>


  )
}

export default Page;
